import './Seminars.css'

const Seminars = () => {

    const seminars = [
        {id: 1 , seminars: "seminar1", organization: "Agile Actors", type: 12 },
        {id: 2 , seminars: "seminar2", organization: "OTE Academy", type: 24 },
        {id: 3 , seminars: "seminar3", organization: "Oracle", type: 18 },
        {id: 4 , seminars: "seminar4", organization: "Academy", type: 25 },
        {id: 5 , seminars: "seminar5", organization: "Oracle", type: 19},
        {id: 6 , seminars: "seminar6", organization: "Agile Actors", type: 12 },
      ];
    
      const nameHandler = (seminar) => {
          
          console.log(seminar)
      }

      const emailHandler = (organization) => {
          
        console.log(organization)
    }


    return (
        <div className = 'seminartable'>
            <table id="myTable">
                    <thead>
                        <tr>
                            <th >Seminars</th>
                            <th >Organization</th>
                            <th >Type</th>
                            
                        </tr>

                        {seminars.map( (seminar) => (
                            <tr key = {seminar.id}>
                                <td onClick={() => nameHandler(seminar.seminar)}>{seminar.name}</td>
                                <td onClick={() => emailHandler(seminar.organization)} >{seminar.email}</td>
                                <td>{seminar.type}</td>
                                
                            </tr>
                        ) )}

                
                
                    </thead>
                </table>
        </div>
    )
}

export default Seminars
